import React from 'react';
import Grid from '@material-ui/core/Grid';
import Fab from '@material-ui/core/Fab';
import ArrowUpIcon from '@material-ui/icons/ArrowUpward';

export default function Buttons() {
    return (
        <Grid 
            container 
        >
            <Grid 
                item
                xs 
            >
                <Fab 
                    variant='extended' 
                >
                    <ArrowUpIcon />
                    Navigation
                </Fab>
            </Grid>
        </Grid>
    );
}
